import Landing from "../../containers/landing";

const PublicLayout: React.FC<{}> = (props: any) => {

  return (
    <div style={{
      backgroundColor: 'rgb(231, 235, 240)',
      flexDirection: 'column',
      height: '100vh',
      width: '100vw',
      display: 'flex'
    }}>
        <div style={{
          alignItems: 'center',
          display: 'flex',
          height: '100%',
          gap: 50,
          justifyContent: 'center'
        }}>
          <Landing />
        </div>
    </div>
  );
};

export default PublicLayout;
